let Users = [
    {
    "GID" : "123456",
    "Password" : "123456"
    },
    {
    "GID" : "123457",
    "Password" : "123456"
    },
    {
    "GID" : "123458",
    "Password" : "123456"
    },
    {
    "GID" : "123459",
    "Password" : "123456"
    },
]


export default Users

/*
IF you want to new User please copy 
=>

"GID" : "a",
"Password" : "b"

give a = GID of new User
give b = Password of new User

*/
